import React from 'react';

import Images from "./Images";
import ScrollButton from "../../helpers/ScrollButton";

function RowImages(props) {
    return (
        <div className="row" style={{
            alignItems:"center"
        }}>
            <div className="row" style={{
                width: "100%",
            }}>
                <Images></Images>
                <Images></Images>
                <Images></Images>
            </div>
            <div style={{
                margin:"20px"
            }}></div>
            <div>
                <ScrollButton></ScrollButton >
                <ScrollButton></ScrollButton>
                <ScrollButton selected={true}></ScrollButton>
                <ScrollButton></ScrollButton>
            </div>
        </div>
    );
}

export default RowImages;
